import './App.css';

 import { Homedsc,Navbar ,Footer} from './conponents';
import { Homepage ,Predictresults} from './containers';
import {BrowserRouter , Routes , Route} from 'react-router-dom';  
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/'>
          <>
            <Navbar />
            <Homedsc />
            <Footer />
          </>
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
